import React, { Component } from "react";
import Col from "react-bootstrap/Col";

const NationalCard = ({ _id, fechaSorteo, numero, serie, fraccion, status }) => {
  return (
    <Col className="coaster-card" md={6}>
      <h4>Sorteo {fechaSorteo} </h4>
      <p> Número: {numero} </p>
      <p> Serie: {serie} </p>
      <p> Fracción: {fraccion} </p>
      <p> Estado: {status} </p>
      <Button variant="dark" onClick={() => this.props.delete(_id)}>
        Darlos de baja
      </Button>
    </Col>
  );
};

export default NationalCard;
